import React from "react";

const SearchResults = (props) => {
  let bookingAttributes = Object.keys(props.results[0]);
  return (
    <table className="table">
      <thead className="thead-dark">
        <tr>
          {bookingAttributes.map((att, index) => {
            return (
              <th scope="col" key={index}>
                {att}
              </th>
            );
          })}
          <th scope="col" key="9">
            nights
          </th>
        </tr>
      </thead>
      <tbody>
        {props.results.map((att, index) => {
          let checkIn = moment([att.checkInDate]);
          let checkOut = moment([att.checkOutDate]);
          return (
            <tr key={index}>
              <td>{att.id}</td>
              <td>{att.title}</td>
              <td>{att.firstName}</td>
              <td>{att.surname}</td>
              <td>{att.email}</td>
              <td>{att.roomId}</td>
              <td>{att.checkInDate}</td>
              <td>{att.checkOutDate}</td>
              <td>{att.checkOutDate.diff(att.checkInDate)}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default SearchResults;
